import React, {useEffect, useState} from 'react';
import styles from './HomepageImage.module.css'
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faPencil, faSave} from "@fortawesome/free-solid-svg-icons";
import HomePageLinks from "@/components/homePageLinks/HomePageLinkComp";
import TopbarLinkComp from "@/components/topbarLink/TopbarLinkComp";
import SearchBarComp from "@/components/searchBar/SearchBarComp";
import Link from "next/link";
import {ApiGetRequest, HandleImageUpload, HandleImageUploadByType} from "@/services/admin";
import Swal from "sweetalert2";
import swal from "sweetalert2";

function HomepageImageComp(props) {
    const [imageUrl, setImageUrl] = useState('');
    // const [backgroundImage, setBackgroundImage] = useState(null);
    const [backgroundImage, setBackgroundImage] = useState("");

    const getBackgroundImage = async () => {
        const result = await ApiGetRequest("/File/GetLatestFileByType", "fileType=mainpage_image&fileDimension=real")
        console.log(result);
        if (!result.errorMessage) {
            console.log(result?.fileVM.thumbnailImageBase64);
            setBackgroundImage(`data:image/png;base64,${result?.fileVM.thumbnailImageBase64}`)
        }
    }

    const handleImageChange = async (event) => {
        const file = event.target.files[0];
        console.log(file)

        const reader = new FileReader();

        reader.onloadend = async () => {
            setBackgroundImage(reader.result);

        };

        if (file) {
            reader.readAsDataURL(file);
            setImageUrl(file)
        }

    };

    const saveImage = async () => {
        /*   const response = await HandleImageUploadByType(backgroundImage, "main page background photo", "mainpage_image")
           console.log(response);*/

        const modalResult = await swal.fire({
            title: "Dikkat",
            confirmButtonText: "Onayla",
            showCancelButton: true,
            text: "Resmi Değiştirmek İstediğine Emin Misin?",
            icon: "warning"
        })
        if (!modalResult.isConfirmed) {
            return
        }

        let response = await HandleImageUploadByType(imageUrl, "main page background photo", "mainpage_image")
        // //console.log(response);
        if (response?.errorMessage !== null) {
            await Swal.fire({
                title: "Hata",
                icon: "error",
                text: response.errorMessage,
                confirmButtonText: "Tamam",
            });

        } else {
            await Swal.fire("Başarıyla Eklendi!");

        }
    }

    useEffect(()=>{
        getBackgroundImage()
    },[])


    return (
        <div className={`${styles['']} container mainContent`}>

            <div className={"d-flex justify-content-center my-4"}>
                <div>
                    <button className={"btn btn-success me-2 "} onClick={
                        () => {
                            saveImage()
                            // getBackgroundImage()
                        }}>
                        <FontAwesomeIcon className={"me-2"} icon={faSave}/>Kaydet
                    </button>
                </div>
                <div>
                    <div className={"d-flex "}
                    >

                        {/*<img alt={""}*/}
                        {/*     id={"companyPic"}*/}
                        {/*     className={"rounded mt-5"}*/}
                        {/*     width={"150px"}*/}
                        {/*     height={"150px"}*/}
                        {/*     src={"https://cdn.kickcharge.com/wp-content/uploads/2018/04/24093540/airprofessionals-logo-1024x625.jpg"}/>*/}


                        <br/>
                        <label htmlFor="inputPic" className={"btn btn-danger"}>
                            <FontAwesomeIcon className={"me-2"} icon={faPencil}/>Fotoğrafı Güncelle</label>
                        <input onChange={handleImageChange}
                            // defaultValue={"https://st3.depositphotos.com/15648834/17930/v/600/depositphotos_179308454-stock-illustration-unknown-person-silhouette-glasses-profile.jpg"}
                               className={"d-none"}
                               id={"inputPic"} type={"file"}
                               accept={"image/jpg, image/png, image/jpg"}/>


                    </div>

                </div>

            </div>

            <div>
                <div className={`${styles['homePageLinks']} homePageLinksClass`}
                     style={{backgroundImage: `url(${backgroundImage})`}}>
                    <div className={`${styles['']} container`}>

                        <TopbarLinkComp/>

                        <div className={`${styles['']} w-100 d-flex justify-content-end text-end`}>
                    <span className={`${styles['homePageMessage']} `}>Binlerce Eskişehir'li <span
                        className={'text-decoration-underline fst-italic '}>eskisehir.net</span> ile iş buluyor!</span>
                        </div>

                        <div className={styles["searchContainer"]}>
                            <SearchBarComp/>
                        </div>

                        <div className={styles['adLinkGroup']}>
                            <Link href={'/listing?type=employee'} className={styles['link']}>
                                {/*<FontAwesomeIcon className={'me-1'} icon={faClipboardUser}  />*/}
                                İŞ İLANLARI</Link>
                            <Link href={'/listing?type=real_estate'} className={styles['link']}>EMLAK</Link>
                            <Link href={'/listing?type=vehicle'} className={styles['link']}>VASITA</Link>
                        </div>

                        <div className={styles['advertiseSearch'] + " d-none d-md-flex"}>
                            <Link href={'/listing'} className={styles['link']}>Garson</Link>
                            <Link href={'/listing'} className={styles['link']}>Tekniker</Link>
                            <Link href={'/listing'} className={styles['link']}>Şoför</Link>
                            <Link href={'/listing'} className={styles['link']}>Mühendis</Link>
                            <Link href={'/listing'} className={styles['link']}>Eğitim</Link>
                            <Link href={'/listing'} className={styles['link']}>Perakende</Link>
                            <Link href={'/listing'} className={styles['link']}>Temizlik Görevlisi</Link>
                            <Link href={'/listing'} className={styles['link']}>Forklift Operatörü</Link>
                            <Link href={'/listing'} className={styles['link']}>Vasıfsız Eleman</Link>
                            <Link href={'/listing'} className={styles['link']}>Kaynakçı</Link>


                        </div>

                    </div>


                </div>
            </div>

        </div>

    );
}

export default HomepageImageComp;